import axios from 'axios';
import React from 'react';

const url = ''

function getNfts() {
  const nfts = axios
    .get('https://api.elrond.com/nfts?size=10000&collection=EQUISTAR-3f393f')
    .then((res) => {
      return res.data;
    });
  return nfts;
}
export { getNfts };
